import React, { useState } from "react";
import axios from "axios";

function App() {
  const [url, setUrl] = useState("");
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const checkUrl = async () => {
    if (!url) {
      setError("⚠ Please enter a URL.");
      return;
    }

    setLoading(true);
    setError("");
    setResult(null);

    try {
      const res = await axios.get(
        `http://127.0.0.1:8000/predict-url?url=${encodeURIComponent(url)}`
      );
      setResult(res.data);
    } catch (err) {
      setError("⚠ Backend not reachable.");
    }

    setLoading(false);
  };

  return (
    <div style={styles.page}>
      <div style={styles.card}>
        <h1 style={styles.title}>⚜ Premium Phishing Detector ⚜</h1>

        <input
          type="text"
          placeholder="Enter URL…"
          value={url}
          onChange={(e) => setUrl(e.target.value)}
          style={styles.input}
        />

        <button onClick={checkUrl} style={styles.button}>
          Analyze
        </button>

        {loading && <p style={styles.loading}>⏳ Scanning...</p>}
        {error && <p style={styles.error}>{error}</p>}

        {result && (
          <div style={styles.resultBox}>
            <h2 style={styles.resultTitle}>RESULT</h2>

            <p style={styles.resultText}>
              <b>Final Prediction:</b>{" "}
              <span
                style={{
                  color:
                    result.final_prediction === "Phishing"
                      ? "#ffcc66"
                      : "#d4af37",
                  fontWeight: "bold",
                }}
              >
                {result.final_prediction}
              </span>
            </p>

            <p style={styles.resultText}>
              <b>ML Prediction:</b> {result.ml_prediction}{" "}
              <span style={{ opacity: 0.7 }}>
                {result.ml_prediction === 1 ? "(Phishing)" : "(Legitimate)"}
              </span>
            </p>

            <p style={styles.resultText}>
              <b>ML Probability:</b>{" "}
              {(result.ml_probability * 100).toFixed(2)}%
            </p>
          </div>
        )}
      </div>
    </div>
  );
}

// -------------------- PREMIUM GOLD STYLES --------------------

const styles = {
  page: {
    minHeight: "100vh",
    background: "linear-gradient(135deg, #0d0d0d, #1a1a1a, #000000)",
    padding: "40px 0",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    color: "#fff",
    fontFamily: "'Poppins', sans-serif",
  },

  card: {
    width: "100%",
    maxWidth: "550px",
    background: "linear-gradient(145deg, #0f0f0f, #1c1c1c)",
    padding: "40px",
    borderRadius: "20px",
    border: "2px solid rgba(212,175,55,0.4)",
    boxShadow:
      "0 0 20px rgba(212,175,55,0.3), 0 0 60px rgba(212,175,55,0.15)",
    textAlign: "center",
  },

  title: {
    fontSize: "32px",
    marginBottom: "30px",
    color: "#d4af37",
    fontWeight: "700",
    textShadow: "0 0 8px rgba(212,175,55,0.5)",
  },

  input: {
    width: "100%",
    padding: "15px",
    borderRadius: "12px",
    border: "2px solid #d4af37",
    background: "rgba(255,255,255,0.05)",
    color: "#fff",
    marginBottom: "20px",
    fontSize: "16px",
    outline: "none",
    boxShadow: "0 0 10px rgba(212,175,55,0.4)",
  },

  button: {
    width: "100%",
    padding: "15px",
    borderRadius: "12px",
    border: "none",
    background:
      "linear-gradient(135deg, #d4af37, #f5d76e, #e6c464)",
    color: "#000",
    fontSize: "18px",
    fontWeight: "700",
    cursor: "pointer",
    boxShadow:
      "0 0 10px rgba(212,175,55,0.6), 0 0 20px rgba(212,175,55,0.4)",
  },

  loading: { fontSize: "18px", color: "#f5d76e", marginTop: "20px" },
  error: { fontSize: "18px", color: "#ff6b6b", marginTop: "20px" },

  resultBox: {
    marginTop: "30px",
    padding: "25px",
    borderRadius: "16px",
    background: "rgba(255,255,255,0.06)",
    border: "2px solid rgba(212,175,55,0.3)",
    boxShadow:
      "0 0 25px rgba(212,175,55,0.3), 0 0 45px rgba(212,175,55,0.2)",
  },

  resultTitle: {
    fontSize: "24px",
    color: "#f5d76e",
    marginBottom: "15px",
    fontWeight: "600",
    textShadow: "0 0 8px rgba(245,215,110,0.6)",
  },

  resultText: {
    fontSize: "18px",
    marginBottom: "10px",
    color: "#fff",
  },
};

export default App;
